    return (
        <div>
            <ApplicationBar/>
            <Container maxWidth="lg" minWidth="sm" style={{border: 'red solid 1px'}}>
                <div id="box1"></div>
                <div id="box2">
                    <div id="text">
                        <Typography variant="h1" noWrap>Hello,</Typography>
                        <Typography variant="h1" noWrap>I'm Latifa</Typography>
                    </div>
                </div>

            </Container>
        </div>
    );
}

export default App;


